import React from 'react';
import Paper from '@material-ui/core/Paper';
import TextField from '@material-ui/core/TextField';


function DataCard({ name, dataFetcher }) {

  return (
    <React.Fragment>
      <Paper>
        <h1>
          {name}
        </h1>
        <TextField
          id="outlined-basic"
          label={name}
          defaultValue="N/A"
          InputProps ={{
            readOnly: true
          }}
          value="1"
          variant="outlined"
        />
      </Paper>
    </React.Fragment>
  )
}

export default DataCard;
